import "./workCardstyle.css"




const Work = () => {
    const [work, setWork] = useState(WorkCardData)
  return (
    <div className="work-container">
            <h1 className="project-heading">Projects</h1>
            <div className="project-container">
            {WorkCardData.map((work,index) =>{
                return(
                    <WorkCard key={index} imgsrc={work.imgsrc} text={work.text} view={work.view} />
                )
             })}
            </div>
        </div>
    
  )
}

export default Work
